import './App.css';

function App() {
  console.log("Hello!");

  const reqBody = {
    "username": "trevor",
    "password": "asdfasdf"
  }


  fetch("api/auth/login", {
    headers: {
      "Content-Type":"application/json",
    },
    method: "post",
    body: JSON.stringify(reqBody)
  }).then((response) => {
    const headers = response.headers;
    console.log(headers.keys)
    response.json()
  })
    .then((data) => console.log(data));

  return (
    <div className="App">
      Hello World
    </div>
  );
}

export default App;
